import "./App.css";

function App() {
  let count = 0;

  let clickPlus = () => {
    count++;
    console.log(count);
  };

  return (
    <div className="App">
      <h2>Counter:</h2>
      <h1>{count}</h1>
      <div>
        <button className="minus">Minus-</button>
        <button className="plus" onClick={clickPlus}>
          Plus+
        </button>
      </div>
    </div>
  );
}

export default App;
